script: |
  super -f text -I q5392.spq | sort > q5392.out

inputs:
  - name: q5392.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE NOT 41 BETWEEN 26 * ( + + col2 ) + - ( col0 ) + + - col2 AND + 44 / - 27 / col1 + col2;
  - name: tab2

outputs:
  - name: q5392.out
    data: |
      46	51	23
      64	77	40
      75	67	58
